import React from 'react';
import './Product.css';
import PropTypes from 'prop-types';

const Product = (props) => {
  return (
    <div className="product">
      <img className="productImage" />
    </div>
  );
}

Product.propTypes = {
  url: PropTypes.number
};

export default Product;
